    constructor(props){
        super(props)
        this.state = {quiz_position:1}
    }
    render(){
        return <div>
           <div className = "QuizQuestion">
             {this.props.quizData.quiz_questions[0].instruction_text}

           </div>
        </div>
    }
}

export default Quiz
